#!/usr/bin/env python

import fire
from recommender import Recommender
import matplotlib.pyplot as plt

class MyClass(object):
    def reccommend(self, data=None):
        Rm = Recommender()
        ret = Rm.reccommend(data)
        return ret

def main():
    fire.Fire(MyClass)

if __name__ == '__main__':
    main()

